  [],\n\t\"revision_timestamp\": \"2015-09-26T23:34:26.872301\",\n\t\"name\": \"dissolved-inorganic-carbon-alkalinity-temperature-salinity-and-other-variables-collected-from-dbf174\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108130 includes biological,
  chemical, discrete sample, meteorological, physical and profile data collected from
  THOMAS G. THOMPSON in the North Pacific Ocean from 2008-08-26 to 2008-09-17 and
  retrieved during cruise 325020080826. These data include ALKALINITY, AMMONIUM, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED INORGANIC CARBON, DISSOLVED
  OXYGEN, Disulfur decafluoride, or Sulfur Pentafluoride (SF5, S2F10), Extinction
  coefficient of the atmosphere, FLUORESCENCE, HYDROSTATIC PRESSURE, NITRATE, NITRITE,
  PHOSPHATE, SALINITY, SILICATE, SULFUR HEXAFLUORIDE (SF6) and WATER TEMPERATURE.
  The instruments used to collect these data include Alkalinity titrator, CTD, Coulometer
  for DIC measurement and bottle. These data were collected by Richard A. Feely and
  Christopher Sabine of US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory
  and Steve Emerson of University of Washington as part of the TN224_2008 data set.nnThe
  International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
  out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
  to quantify changes in storage and transport of heat, fresh water, carbon dioxide
  (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
